{
  "source_code": "using System;
using System.Collections.Generic;
using System.IO;
using System.Text.Json;

public class WorkoutPlaylistGenerator : IGeneratedModule
{
    public string Name { get; set; } = "Workout Playlist Generator";

    private class Exercise
    {
        public string Name { get; set; }
        public int DurationSeconds { get; set; }
        public string MusicGenre { get; set; }
    }

    private class Playlist
    {
        public List<Exercise> Exercises { get; set; } = new List<Exercise>();
        public int TotalDuration { get; set; }
    }

    public bool Main(string dataFolder)
    {
        Console.WriteLine("Starting Workout Playlist Generator module");

        try
        {
            string configPath = Path.Combine(dataFolder, "workout_config.json");
            string outputPath = Path.Combine(dataFolder, "workout_playlist.json");

            if (!File.Exists(configPath))
            {
                CreateDefaultConfig(configPath);
                Console.WriteLine("Created default workout configuration file");
            }

            string jsonData = File.ReadAllText(configPath);
            var exercises = JsonSerializer.Deserialize<List<Exercise>>(jsonData);

            if (exercises == null || exercises.Count == 0)
            {
                Console.WriteLine("No exercises found in configuration");
                return false;
            }

            var playlist = new Playlist();
            int totalDuration = 0;

            foreach (var exercise in exercises)
            {
                playlist.Exercises.Add(exercise);
                totalDuration += exercise.DurationSeconds;
            }

            playlist.TotalDuration = totalDuration;

            string playlistJson = JsonSerializer.Serialize(playlist, new JsonSerializerOptions { WriteIndented = true });
            File.WriteAllText(outputPath, playlistJson);

            Console.WriteLine("Successfully generated workout playlist");
            Console.WriteLine("Total workout duration: " + TimeSpan.FromSeconds(totalDuration).ToString("hh':'mm':'ss"));

            return true;
        }
        catch (Exception ex)
        {
            Console.WriteLine("Error generating workout playlist: " + ex.Message);
            return false;
        }
    }

    private void CreateDefaultConfig(string path)
    {
        var defaultExercises = new List<Exercise>
        {
            new Exercise { Name = "Warm-up", DurationSeconds = 300, MusicGenre = "Pop" },
            new Exercise { Name = "Cardio", DurationSeconds = 600, MusicGenre = "Electronic" },
            new Exercise { Name = "Strength Training", DurationSeconds = 900, MusicGenre = "Rock" },
            new Exercise { Name = "Cool Down", DurationSeconds = 300, MusicGenre = "Ambient" }
        };

        string json = JsonSerializer.Serialize(defaultExercises, new JsonSerializerOptions { WriteIndented = true });
        File.WriteAllText(path, json);
    }
}",
